export class ERG {
    constructor(name, numberOfMembers, _id) {
        // check for types and then
        // do assignment to fields if needed
        // now we are just assiging it
        // without checking for the types
        this._id = _id;
        this.name = name;
        this.numberOfMembers = numberOfMembers;
    }
}
